import TopPageTitle from "../../../../common/components/topPageTitle/Index";
import { EmployeesCard } from "./components/EmployeesCard";
import { FiPlus } from "react-icons/fi";
import { NavLink } from "react-router-dom";
import { GirdAndListView } from "../../../../common/components/GirdAndListView/GirdAndListView";
import { BsCaretDownFill, BsCaretUpFill } from "react-icons/bs";

export const EmployeesManagement = () => {
  return (
    <>
      <div className="custom_container">
        <div className="row">
          <div className="col-xxl-9 col-xl-9 col-lg-9 col-md-6 col-sm-5 col-5">
            <TopPageTitle Name="Employees’ Management" />
          </div>
          <div className="col-xxl-3 col-xl-3 col-lg-3 col-md-6 col-sm-7 col-7 MyAttendence_next_page">
            <NavLink to="/">
              <span>Add Employee</span>
              <FiPlus />
            </NavLink>
          </div>
        </div>

        <GirdAndListView
          GirdView={<EmployeesCard />}
          ListView={<EmployeesListView />}
        />
      </div>
    </>
  );
};
const EmployeesListView = () => {
  const IssueAssetsApp = (props) => {
    return (
      <>
        <tr>
          <td>{props.id}</td>
          <td>{props.Photo}</td>
          <td>{props.Title}</td>
          <td>{props.EmployeeName}</td>
          <td>{props.EmailID}</td>
          <td>{props.ContactNumber}</td>
        </tr>
      </>
    );
  };
  const IssueAssetsAppData = [
    {
      id: "Basic Salary",
      Photo: "112%",
      Title: "Percentage",
      EmployeeName: "Yes",
      ContactNumber: "Yes",
      EmailID: "Yes",
    },
  ];

  return (
    <>
      <div className="m_t"></div>
      <div className="profile_iner_cont ">
        <table className="table text-center IssueAssets_top_div mt-0">
          <thead>
            <tr>
              <th scope="col">E.ID</th>
              <th scope="col">Photo</th>
              <th scope="col">Title</th>
              <th scope="col">Employee Name</th>
              <th scope="col">Email ID</th>
              <th scope="col">Contact Number</th>
            </tr>
          </thead>
          <tbody>
            {IssueAssetsAppData.map((val, i) => {
              return (
                <IssueAssetsApp
                  key={i}
                  id={val.id}
                  Photo={val.Photo}
                  Title={val.Title}
                  EmployeeName={val.EmployeeName}
                  EmailID={val.EmailID}
                  ContactNumber={val.ContactNumber}
                />
              );
            })}
          </tbody>
        </table>
      </div>
    </>
  );
};
